The syntax for `std::floor()` is:

`double floor(double x);`

Here, a sample code snippet to demonstrate its usage:

```cpp

#include <iostream>
#include <cmath>

int main() {
    double num1 = 5.7;
    double num2 = -3.2;

    std::cout << "Floor of " << num1 << " is " << std::floor(num1) << std::endl;
    std::cout << "Floor of " << num2 << " is " << std::floor(num2) << std::endl;

    return 0;
}

```

Output:
```
Floor of 5.7 is 5.0 
Floor of -3.2 is -4.0 
```

As you can see, `std::floor()` rounds down to the nearest integer.

