In C++, `std::floor()` is a function from the `<cmath>` library that returns the largest integer less than or equal to a given number.

The syntax is: `double floor(double num)`

Here's an example:

```cpp

#include <cmath>

int main() {
    double x = 3.7;
    double y = -2.5;

    std::cout << "Floor of " << x << " is " << std::floor(x) << std::endl;
    std::cout << "Floor of " << y << " is " << std::floor(y) << std::endl;

    return 0;
}

```

Output:
```
Floor of 3.7 is 3.0 
Floor of -2.5 is -3.0 
```

As you can see, `std::floor()` always rounds down to the nearest integer, even if the decimal part is exactly `.5`.

Here's an example:
```
#include <cmath>

double x = 3.7;
double result = std::floor(x); // result will be 3.0

double y = -2.3;
double result2 = std::floor(y); // result2 will be -3.0 (not -2.0)
```

The `std::floor()` function takes a single argument, which can be a `float`, `double`, or `long double` value.

